import {
	mapActions
} from 'vuex';
import { scrollMixins } from '@/mixins/scroll.js'
export default {
	props: {
		items: {
		  type: Array,
		  default:() => []
		}
	},

	mixins:[scrollMixins],

	data: () => ({
		detailStep: 1,

		placeDetail: [],

		drawer: false,

		operates: ['买入', '卖出', '补仓', '止损'],

	}),
	methods: {
		...mapActions(['changeLay']),

		transUpperCase(data) { //交易对转大写
			return data.toUpperCase();
		},

		clickClose(){//点击关闭抽屉
			this.drawer = false;
			this.beforeClose();
		},

		openDrawer(id) {//打开抽屉

			this.changeLay(true);

			$ax.getAjaxData('/EasWebUser/getPlaceID', {
				id: id
			}, (res) => {
				if (res.code == 1) {
					let list = JSON.parse(JSON.stringify(res.data));
					list.forEach(item => {
						item.placeTime = this.$moment(Number(item.placeTime)).format('YYYY-MM-DD HH:mm:ss')
					})

					this.placeDetail = list;
					this.detailStep = 1;
					this.drawer = true;
					this.afterOpen();
				} else {

					console.log('错误错误')
				}
				this.changeLay(false);
			}, {
				hasToken: true
			});



		},

	},
	computed: {

	},
	mounted() {
	}
}
